import classes from './MessageComponent.module.css';

const textInput = ( props ) => {

    return (
    <div>
        <input type='text' id='msginput' name='texter' classname={classes.inputfield} />
        <p> Hola Buenos Dias </p>
        <button classname={classes.sendbtn} type='submit' name='submit' > Send </button>
    </div>
    );
}

export default textInput;
